import React from 'react';
import Navbar from './component/Navbar';
import Jumbotron from './component/Jumbotron';
import Profil from './component/Profil';
import './App.css';

class App extends React.Component {
  render () {
    return (
      <div className="utama">
        <Navbar />
        <Jumbotron />
        <Profil />
      </div>
    );
  }
}

export default App;
